import React, { Component } from 'react';

export interface IProduct {
    id: number;
    category: string;
    name: string;
    oriPrice: number;
    salePrice: number;
    tag: string;
}

interface Props {
    index: number;
    item: IProduct;
}
interface State {

}

export default class Product extends Component<Props, State> {
    public state = {};

    public render() {
        const { index, item } = this.props;
        return (
            <div key={index}>
                <p>{item.name}</p>
                <p>{item.oriPrice}</p>
                <p>{item.salePrice}</p>
                <p>{item.tag}</p>
            </div>
        );
    }
}
